import React, { useState, useEffect } from 'react';
import './App.css';
import SudokuGenerator from './SudokuGenerator'; // Import the SudokuGenerator class

function SudokuView() {
  const [grid, setGrid] = useState(Array(9).fill().map(() => Array(9).fill(0)));

  useEffect(() => {
    const generator = new SudokuGenerator();
    const newGrid = generator.generate();
    setGrid(newGrid);
  }, []);

  return (
    <div className="App">
      {grid.map((row, i) => (
        <div key={i}>
          {row.map((value, j) => <span key={j}>{value} </span>)}
          <br />
        </div>
      ))}
    </div>
  );
}

export default SudokuView;
